     // complete when progress is greater than 1\n                takeWhile((progress) => progress  Math.round(progress * count)),\n                // make sure that last emitted value is count\n                endWith(count),\n                distinctUntilChanged()\n            );\n        })\n    )\n                    \n                \n                    \n                        \n                                Defined in src/app/shared/directives/count-up/count-up.directive.ts:30\n                        \n                    \n\n\n        \n    \n    \n        \n            \n                \n                    \n                    \n                            Private\n                            Readonly\n                        duration$\n                        \n                    \n                \n            \n                \n                    \n                        Default value : new BehaviorSubject(2000)\n                    \n                \n                    \n                        \n                                Defined in src/app/shared/directives/count-up/count-up.directive.ts:29\n                        \n                    \n\n\n        \n    \n\n\n            \n    \n        Accessors\n    \n        \n            \n                \n                    \n                        \n                        count\n                    \n                \n\n\n                \n                    \n                        setcount(count: number)\n                    \n                \n                            \n                                \n                                    Defined in src/app/shared/directives/count-up/count-up.directive.ts:58\n                                \n                            \n                    \n                        \n\n                                \n                                        Parameters :\n                                        \n                             